import UserCho from "./UserCho";
import UserGu from "./UserGu";

const Janken = () => {

    return (
        <div className="Select">
            <div className="User">

                <div className="Gu" onClick={UserGu}>
                    <h1>✊</h1>

                </div>

                <div className="Cho" onClick={UserCho}>
                    <h1>✌️</h1>

                </div>

                <div className="Par" onClick={UserPar}>
                    <h1>✋</h1>

                </div>
            </div>

            <div className="Pc">

            <PcHand />

            </div>
        </div>

    );


};
export default Janken;
